// Decrypt a single question
export function decryptQuestion(encryptedStr) {
    try {
        const [ivHex, dataHex, authTagHex] = encryptedStr.split(':');
        
        const decipher = crypto.createDecipheriv(
            'aes-256-gcm',
            Buffer.from(ENCRYPTION_KEY, 'hex'),
            Buffer.from(ivHex, 'hex')
        );
        
        decipher.setAuthTag(Buffer.from(authTagHex, 'hex'));
        
        let decrypted = decipher.update(dataHex, 'hex', 'utf8');
        decrypted += decipher.final('utf8');
        
        return JSON.parse(decrypted);
    } catch (error) {
        console.error('Decryption failed:', error);
        return null;
    }
}

// Verify user answer against encrypted question
export function verifyAnswer(encryptedQuestion, userAnswer) {
    const question = decryptQuestion(encryptedQuestion);
    if (!question) {
        return { 
            correct: false, 
            explanation: "Error verifying answer" 
        };
    }
    
    return {
        correct: userAnswer === question.correct,
        explanation: question.explanation,
        correctAnswer: question.correct
    };
}

